import React from "react";
import {
  StyleSheet,
  processColor,
  View,
  Dimensions,
  StatusBar,
} from "react-native";

import G from "./assets/G";
import N from "./assets/N";
import L from "./assets/L";
import C from "./assets/C";

// const width = "80%";
// const height = "40%";

const colors = {
  black: "#010202",
  cyan: "#29AAE2",
  magenta: "#E32185",
  yellow: "#FAEA26",
};

const { width, height } = Dimensions.get("window");

const isPortrait = () => {
  return height >= width;
};

const isLandscape = () => {
  return width >= height;
};

console.log(width, height);

const styles = StyleSheet.create({
  container: {
    display: "flex",
    flex: 4,
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    zIndex: 0,
  },
  row: {
    flex: 1,
    width: "100%",
    height: "100%",
    overflow: "hidden",
    zIndex: 1,

    shadowColor: "#000",
    shadowOffset: { width: 0, height: 1 },
    shadowOpacity: 0.8,
    shadowRadius: 2,
    elevation: 5,
  },
  letter: {
    margin: "auto",
  },
});

export default App = () => {
  return (
    <View style={styles.container}>
      <StatusBar hidden />
      <View style={{ ...styles.row, backgroundColor: colors.cyan }}>
        <G color={processColor(colors.black)} style={styles.letter} />
      </View>
    </View>
  );
};
